import React from 'react'
import { Link } from 'react-router-dom' ;
function Navbar() {
  return (
   <ul className="nav">
    <li className="nav-item">
      <Link className='nav-link' to="/">Home</Link>
    </li>
   </ul>
  )
}

export default Navbar
